import React from 'react';
import { Star } from 'lucide-react';
import './ReviewSection.css';

const ReviewsSection = () => {
  const reviews = [
    {
      id: 1,
      name: "Meher",
      field: "Web Development",
      rating: 5,
      review: "Outstanding work on our e-commerce platform. The code quality is exceptional and the project was delivered ahead of schedule.",
      avatar: "M",
      date: "2 weeks ago"
    },
    {
      id: 2,
      name: "Syamanth",
      field: "Mobile App Development",
      rating: 5,
      review: "Incredible attention to detail in our React Native app. The performance optimizations exceeded our expectations.",
      avatar: "S",
      date: "1 month ago"
    },
    {
      id: 3,
      name: "Chandu",
      field: "UI/UX Design",
      rating: 4,
      review: "Great design skills and creative approach to our brand identity. Final deliverables were top-notch.",
      avatar: "C",
      date: "3 weeks ago"
    },
    {
      id: 4,
      name: "Hari",
      field: "Backend Development",
      rating: 5,
      review: "Solid backend architecture and security implementations. Very knowledgeable and reliable developer.",
      avatar: "H",
      date: "1 week ago"
    },
    {
      id: 5,
      name: "Kalyan",
      field: "Full Stack Development",
      rating: 5,
      review: "Complete full-stack solution delivered perfectly. Everything was seamlessly integrated and documented.",
      avatar: "K",
      date: "4 days ago"
    }
  ];

  const renderStars = (rating) => {
    return Array.from({ length: 5 }, (_, index) => (
      <Star
        key={index}
        className={`w-5 h-5 transition-colors duration-200 ${
          index < rating
            ? 'text-orange-400 fill-orange-300'
            : 'text-gray-300'
        }`}
      />
    ));
  };

  const getAverageRating = () => {
    const total = reviews.reduce((sum, review) => sum + review.rating, 0);
    return (total / reviews.length).toFixed(1);
  };

  return (
    <div className="reviews-container">
      <div className="reviews-header text-center mb-12">
        <h2 className="text-4xl font-extrabold text-gray-800 mb-3">Client Reviews</h2>
        <p className="text-lg text-gray-600 max-w-2xl mx-auto mb-5">
          See how businesses around the world benefit from our services.
        </p>
        <div className="flex items-center justify-center gap-3">
          <div className="flex">{renderStars(5)}</div>
          <span className="text-xl font-semibold text-gray-800">
            {getAverageRating()}
          </span>
          <span className="text-gray-600">
            ({reviews.length} reviews)
          </span>
        </div>
      </div>

      {/* Reviews Grid */}
      <div className="reviews-grid grid gap-8 grid-cols-1 md:grid-cols-2 lg:grid-cols-3">
        {reviews.map((review) => (
          <div key={review.id} className="review-card bg-white p-6 rounded-2xl shadow-lg hover:shadow-xl transition-shadow duration-300">
            <div className="review-header flex justify-between items-start mb-4">
              <div className="reviewer-info flex items-center gap-4">
                <div className="avatar w-12 h-12 bg-gradient-to-tr from-green-400 to-blue-500 text-white flex items-center justify-center rounded-full font-semibold text-lg">
                  {review.avatar}
                </div>
                <div>
                  <h4 className="text-md font-bold text-gray-800">{review.name}</h4>
                  <p className="text-sm text-gray-500">{review.field}</p>
                </div>
              </div>
              <div className="review-meta text-right">
                <div className="rating flex justify-end">{renderStars(review.rating)}</div>
                <span className="text-xs text-gray-400">{review.date}</span>
              </div>
            </div>
            <div className="review-content">
              <p className="text-gray-700 text-sm italic">"{review.review}"</p>
            </div>
          </div>
        ))}
      </div>

      {/* Call to Action */}
      <div className="cta-section text-center mt-16">
        <h3 className="text-2xl font-bold text-gray-800 mb-2">
          Let's build something great together
        </h3>
        <p className="text-gray-600 mb-6">
          Join satisfied clients and bring your project to life with us.
        </p>
        <button className="cta-button bg-green-500 text-white px-6 py-3 rounded-full font-semibold hover:bg-green-600 transition duration-300">
          Get Started Today
        </button>
      </div>
    </div>
  );
};

export default ReviewsSection;
